const PageBanner = () => {
  const url = new URL(window.location);
  console.log(url);

  return (
    <>
      <div className="container d-sm-flex justify-content-between">
        <h1>{url.pathname.substring(1)}</h1>
        <p>{url.pathname.substring(1)}</p>
      </div>
    </>
  );
};

export default PageBanner;
